import React from 'react';
import { Button, Container, Row, Col } from 'react-bootstrap';

class StageOne extends React.Component {
    render() {
        return (
            <Container>
                <Row>My Fruit Store</Row>
                <Row>
                    <Button>Page One</Button>
                    <Button>Page Two</Button>
                </Row>
                <Row>
                    <Col>side section</Col>    
                    <Col>Form componet</Col>    
                </Row>
            </Container>
        )
    }
}
export default StageOne;
